// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.7.0 < 0.9.0;

contract quiz1 {
    modifier numMoreThan5(uint _num)  {
        require(_num>5, "_num must be more than 5");
        _;
    }

    function value(uint _num) public pure numMoreThan5(_num) returns(uint) {
        return _num;
    }
}



contract quiz2 {
    modifier numMoreThan9(uint _num) {
        require(_num>=10, "");
        _;
    }   
    function minus10(uint _num) public pure numMoreThan9(_num) returns(uint) {
        return _num-10;
    }

    function plus10(uint _num) public pure returns(uint) {
        return _num+10;
    }
}

contract quiz3 {
    enum Switch {
        TurnOff,
        TurnOn
    }

    Switch public lightStatus = Switch.TurnOn;

    function turnOnTheLight() public {
        require(lightStatus == Switch.TurnOff, "");
        lightStatus = Switch.TurnOff;
    }
}

library Math {
    function sub(uint _num1, uint _num2) public pure returns(uint) {
        require(_num1 + _num2 > _num1, "");
        return _num1 - _num2;
    }

}

